define('products',['jquery','utilities','globals','accounting','amaran','ezstorage'], function($,utilities,globals,accounting){

	return {
		init : function(visitor){
			// 
			// 		Setup content on the page
			//
			

			function productOptionSet(){
				// Item selection was executed
				var item = $(this);
				var option = item.data('option');
				var value = "";
				var productId = item.data('product');
				if(item.data('value')){
					value = item.data('value');
				}else{
					// Read from value
					value = item.val();
				}

				saveSelection(productId, option,value);

			}

			function productQtySet(){
				// Item selection was executed
				var item = $(this);
				var value = "";
				var productId = item.data('product');
				if(item.data('value')){
					value = item.data('value');
				}else{
					// Read from value
					value = item.val();
				}

				saveQty(productId, value);

			}


			// Add to cart
			function addToCart(){
				// Make sure product id is present
				var that = $(this); 
				var productId = that.data('product-id');
				if(productId){
					// Get product item for quick lookup
					var products = globals.PRODUCTS.filter(function(productItem){if(productItem.id==productId)return true;});
					var product;
					if(products.length>0){
						product = products[0];
					}

					if(product){
						// Check if options were provided in data
						var options = {};
						var optionList = utilities.getProductOptionList(productId);
						$.each(optionList,function(index,option){
							if(that.data(option)){
								options[option] = that.data(option);
							}
						});

						// Get qty
						var qty = 0;
						if(that.data('product-qty')) qty = that.data('product-qty');


						// Now check storage if not enough options were provided
						if($.ezstorage.enabled()){
							// Check if we need to get qty
							if(qty==0) qty = $.ezstorage.get(productId + ' : qty') || 1;

							// Check for options
							$.each(optionList,function(index,option){
								// Make sure it's not already set
								if(!options[option]){
									// Check storage
									var value = $.ezstorage.get(productId + ' : ' + option);
									if(value){
										// Was stored in memory 
										options[option] = value;
									}else{
										if(product.options[option]){
											if(product.options[option].length>0){
												options[option] = product.options[option][0].value;
											}
										}
									}	
								}
							});
						}


						// Show message only if image is present
						if(!globals.NOCARTMESSAGE){

							var content = {};
							var theme = "colorful";
							if(utilities.libraryImage(product,0).length>0){
								content = {
							        img:utilities.libraryImage(product,0),
							        user:'Item added to cart',
							        message:product.name + ' added successfully'
							       }
							    theme = "user blue";
							}else{
						        content = {
						            bgcolor:'#27ae60',
						            color:'#fff',
							        message:'<h4>' + qty + ' X ' + product.name + '</h4>added successfully'
						        }
							}

							// Display message if not disabled
							var delay=parseInt(that.data('goto-delay'));
							if(delay>0){
								setTimeout(function(){
									$.amaran({
									    content:content,
									    position:'top right',
									    theme:theme,
									    closeButton:true
									});
								},delay);
							}else{
								$.amaran({
								    content:content,
								    position:'top right',
								    theme:theme,
								    closeButton:true
								});

							}
						}



						// Got the product & options
						visitor.addToCart(product.id,qty,options);
						// Check if we're going to the next step
						var goTo = that.data("goto");
						if(goTo){
							// Go to next step 
							setTimeout(function(){document.location.href=goTo},200);
						}
						
					}
				}
			}

			function saveSelection(productId,option,value){
				// Save it in local storage
				if($.ezstorage.enabled()){
					$.ezstorage.set(productId + ' : ' + option, value);
				}
			}

			function saveQty(productId,qty){
				// Save it in local storage
				if($.ezstorage.enabled()){
					$.ezstorage.set(productId + ' : qty', qty);
				}
			}			

			function populateOptions(element,product, option, arr){
				element.find("[data-type='product-options-" + option + "']").each(function(index,item){
					// Set the ID of the variable
					utilities.setDOMIDAttribute(item,option + "-" + product.id);

					// Now retrieve that unique item
					item = $(item);

					// Save product ID
					item.data('product',product.id);

					// Figure out repeater type (default to select)
					var type= item.data('type-repeater') || 'select';
					var defaultItemValue = "";

					$.each(arr, function(index,optionitem){ 
					     $(item)
					         .append($(
					         		"<" + (type=="ul"?"li":"option") + ">"
					         		+ (type=="ul"?
					         			"<a data-product='" + product.id + "' data-value='" + optionitem.value + "' data-option='" + option + "' id='" + option + "-" + product.id + "-" + index + "' " + 
					         				(option=="color" ? "style='background-color:" + optionitem.code + "'> </a>" : "") 
					         		 : optionitem.value ) + 
					         				"</" + (type=="ul"?"li":"option") + ">")
					         .attr("value",optionitem.value)
					         .attr("class",(index==0?"selected":""))); 
					     // Attach product selection call back
					     if(type!='select'){
					     	// Must be a href
						     item.find("#" + option + "-" + product.id + "-" + index).on("click",productOptionSet);
					     }

					     // Check if we're selecting this default selection
					     if(index==0){
					     	//saveSelection(product.id,option,optionitem.value);
					     	defaultItemValue = optionitem.value;
					     }

					});

					// Handling of on change event
					if(type=="select"){
						if(typeof(item.minimalect)!==undefined){
							// Minimalect plugin
							// item.minimalect().onchange(function(value,text){alert('adfs')});
							item.minimalect({onchange:function(value,text){
								item.val(text);
								item.trigger("change");
							}});

						}
						item.change(productOptionSet);
						// set default selection
						item.val(defaultItemValue); 
					}
				});	
			}

			

		  	// Misc things
		  	$("body").find("[data-action='addtocart']").each(function(index,item){
				item = $(item);
				// Check if product is present
				if(item.data('product-id')){
					item.click(addToCart);
				}
			});

		  	// Check if visitor has shopping cart items
		  	if(visitor.shoppingCart)
		  		if(visitor.shoppingCart.length>0)
		  			visitor.cartUpdateTotals();

		  	// Product based templates
			if(globals.PRODUCTS)
				if(globals.PRODUCTS.length>0){
					// Locate all modals
					$("body").find("[data-template='product-details']").each(function(index,element){
						// We found a template now go through all the products and create relevant content
						element = $(element);
						var originalElement = element;
						var originalElementClone = element.clone(true);
						$.each(globals.PRODUCTS,function(index,product){
							// Make a copy of the element
							var newElement = (index==0?element:originalElementClone.clone(true));
							// Now update values within the element

							// Set the ID
							newElement.attr("id","product-" + product.id + (newElement.attr('role')=='dialog'?"-modal":""));

							// Set other attributes
							// utilities.setVal(newElement,"name",product.name);
							// utilities.setVal(newElement,"description",product.description);
							// utilities.setVal(newElement,"shortDescription",product.shortDescription);
							// utilities.setVal(newElement,"price",accounting.formatMoney(product.price));
							// utilities.setVal(newElement,"regularPrice",accounting.formatMoney(product.regularPrice));
							// utilities.setVal(newElement,"code",product.code);
							utilities.setValues(newElement,product,visitor);

							// Set special items like lists
							//  data-optionlist="sizes" data-optionlist-divider=" / "
							newElement.find("[data-optionlist]").each(function(index,item){
								item = $(item);
								var divider = item.data("optionlist-divider") || " / ";
								// Get list
								var list = utilities.getProductOptions(product.id,item.data('optionlist'),'value');
								if(list.length>0){
									var ret = "";
									$.each(list,function(listindex,listitem){
										ret += (ret.length>0?divider:"") + listitem; 
									});
									item.html(ret);
								}
							});


							// ADD TO CART
							newElement.find("[data-action='addtocart']").each(function(index,item){
									item = $(item);
									// Add necessery items for add to cart
									item.data('product-id',product.id);
									// Wire add to cart
									item.click(addToCart);
							});

							// QTY
							//     data-type="product-options-qty" data-type-repeater="select"
							newElement.find("[data-type='product-options-qty']").each(function(index,item){
								// Set the ID of the variable
								utilities.setDOMIDAttribute(item,"qty-" + product.id + (newElement.attr('role')=='dialog'?"-modal":""));
								// Now retrieve that unique item
								item = $(item);

								// Figure out repeater type (default to select)
								var type= item.data('type-repeater') || 'select';
								for(var i=1;i<=5;i++){ 
								     $(item)
								         .append($("<" + (type=="ul"?"li":"option") + "></" + (type=="ul"?"li":"option") + ">")
								         .attr("value",i)
								         .text(i)); 
								};

								$(item).data("product",product.id);

								// Select default
								if(type=="select"){
									if(typeof(item.minimalect)!==undefined){
										// Minimalect plugin
										// item.minimalect().onchange(function(value,text){alert('adfs')});
										item.minimalect({onchange:function(value,text){
											item.val(text);
											item.trigger("change");
										}});

									}

									$(item).change(productQtySet);

									$(item).val(1);
								} 
							});

							// DATA BINDINGS
							// Check if there's bindings  data-bind="data-large:product-image"
							newElement.find("[data-bind]").each(function(index,item){
								// Now get value
								var ba = $(item).data("bind").split(':');
								if(ba.length==2){
									var value = "";
									// Determine value
									switch(ba[1]){
										case "product-image":
											value = utilities.libraryImage(product);
										break;
										case "productId":
											value = "#product-" + product.id + '-modal';
										break;
										default:
											value = product[ba[1]];
										break;
									}
									// figure out value type
									$(item).attr('data-' + ba[0].replace('data-',''), value);
								};

							});

							

							//
							// PRODUCT OPTIONS
							//
							if(product.options){
								// COLOR
								//	 data-type="product-options-color" data-type-repeater="ul"
								if(product.options.color){
									populateOptions(newElement,product, 'color', product.options.color);
								}


								if(product.options.size){
									populateOptions(newElement,product, 'size', product.options.size);
								}
															
							}

							// data-type="product-image" 
							// Populate images
							utilities.populateImages(newElement,product);

							// Now add this bellow the template
							originalElement.after(newElement);

						});
					});
				}

			


		}
	}



});
